import React from "react";
import {Link, Outlet} from "react-router-dom";
import './Navbar.css'

const  Navbar = () =>{
    return(
        <div>
            <ui className="navbar">

                <li><Link className="" to="/">Home page</Link></li>
                <li><Link to="contactus">Contact us</Link></li>
                <li><Link to="aboutus">About us</Link></li>
            </ui>
            <Outlet/>
        </div>
    );
}

export default Navbar
